package org.nhan.entity;

public class Number {
	public double a;
	public double b;
	public Number(double a, double b) {
		super();
		// TODO Auto-generated constructor stub
		this.a = a;
		this.b = b;
	}
	public Number() {
		super();
		// TODO Auto-generated constructor stub
	}
	public double getA() {
		return a;
	}
	public void setA(double a) {
		this.a = a;
	}
	public double getB() {
		return b;
	}
	public void setB(double b) {
		this.b = b;
	}
}
